import React from "react";
import Redirect from "react-router-dom";

export default function CompleteChange(props){

    function Complete(){
        return <Redirect to="/home" />
    }

    return(
        <div>
            <h1>sadasf</h1>
            <button className="btn btn-outline-danger" onClick={()=>Complete()}>Quay Trở lại trang đăng nhập</button>
        </div>
    )
}
